export const DELETE_MENU = 'DELETE_MENU';
export const deleteMenuAction = (menus) => {
  return {
    type: 'DELETE_MENU',
    payload: menus
  }
};

export const FETCH_MENUS = 'FETCH_MENUS';
export const fetchMenusAction = (menus) => {
  return {
    type: 'FETCH_MENUS',
    payload: menus
  }
};
